itsmade)
If you are making Shrimp Cocktail...then MAKE Shrimp Cocktail!! Yes you can just defrost some cooked shrimp and toss it out there, but it is SO much better if you cook raw shrimp the night before. 

Method: Bring a pot of chicken stock, salt, peppercorns, half of a lemon, quartered shallot and a couple of garlic cloves to a boil. Remove from heat, add thawed UNCOOKED shrimp (peeled, deveined and either 8-12 or 16-20 size), cover and let sit for 2-3 minutes. Strain (save the stock for some future use...it is super flavourful) and refrigerate overnight.

To keep things keto (and f‚Äôing delicious) I made a cocktail sauce using no sugar ketchup, extra hot horseradish, Dijon, a tiny dab of mayo and a little cracked pepper.

